const overTime = (res) => {
    let domain = window.location.origin;
    if(res && res.code === '-4' && domain.indexOf('localhost') < 0){
         localStorage.removeItem('hasLoginOne');
        window.location.href = domain + '/h5portal/onePortal/index.html#/login';
        return;
    }
}

export{
    overTime
}
